import React,{useState,useEffect} from 'react';
import './App.css';

function App() {
  let [stock,setStock,lastStockUpdate,setLastStockUpdate] = useState({});

  useEffect(()=>
  {
    async function fetchData()
    {
      const response = await fetch('https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=MSFT&interval=5min&apikey=S9C3XDXUHXF2Q4BB');
      const data = await response.json();
      setStock(data['Time Series (5min)']);
      setLastStockUpdate(data['Meta Data']['3. Last Refreshed'])
    }
    fetchData();
  },[setLastStockUpdate,setStock])
  return (
    <div className="App">
      {
        console.log(stock?stock:"Not Yet")
      }
    </div>
  );
}

export default App;
